import styled from 'styled-components';

export const Container = styled.main`
  margin-top: 40px;

.grid {

  display: grid;
  grid-gap: 10px;

  grid-template-columns: repeat(auto-fill, minmax(200px,250px));
  width: 100%;
  height: 100%;
  padding: 4%;
}

`
